    and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
    Legislationu00e2u0080u0094Preemption. The STATE System houses current and historical
    state-level legislative data on tobacco use prevention and control policies. Data
    are reported on a quarterly basis. Data include information related to summary state
    preemption of more stringent local laws on advertising, smokefree indoor air, and
